import React from 'react';
import { Container } from './style';
import StockList from '../../components/stocklist';
import CandleChart from '../../components/candlestickchart';
import PortfolioSummary from '../../components/portfoliosummary';

export default function Market() {
    // Dados estáticos para demonstração
    const stocks = [
        { symbol: 'PETR4', name: 'Petrobras', price: '32.45', change: '0.02' },
        { symbol: 'VALE3', name: 'Vale', price: '68.90', change: '-0.01' },
        { symbol: 'ITUB4', name: 'Itaú Unibanco', price: '26.75', change: '0.03' }
    ];
    
    const selectedStock = stocks[0];
    
    const portfolio = [
        { symbol: 'PETR4', name: 'Petrobras', quantity: 100, avgPrice: '30.50' },
        { symbol: 'VALE3', name: 'Vale', quantity: 50, avgPrice: '65.20' }
    ];

    return (
        <Container>
            <StockList 
                stocks={stocks} 
                selectedSymbol={selectedStock.symbol}
            />
            <CandleChart 
                symbol={selectedStock.symbol} 
                currentPrice={selectedStock.price}
            />
            <PortfolioSummary portfolio={portfolio} stocks={stocks} />
        </Container>
    );
}
